import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import HelloWorld from './App';
import ProfileLink from './ProfileLink';
import reportWebVitals from './reportWebVitals';

function testArray(...args){
  if (args){
    for(let key in args){
      console.log(key)
    }
  }
}

testArray('misha')

ReactDOM.render(
  <React.StrictMode>
   <div>
     <HelloWorld myframe='react'/> 
   </div>
   <div><ProfileLink url='https://youtube.com/' label='Misha' decoration=''/> </div> 
  </React.StrictMode>,
  document.getElementById('root')
);

